I am using typeorm and postgres database. I have a column in my table that stores json data. I am trying to figure out what type to use in my entity for this column.

Here is my entity:

\begin{code}
import { Entity, BaseEntity, Column, PrimaryGeneratedColumn } from 'typeorm';

@Entity()
export class MyEntity extends BaseEntity {
  @PrimaryGeneratedColumn()
  id: number;

  @Column()
  jsonData: ???;
}
\end{code}

What type should I use for `jsonData`?

Answer: `object`

Here is the corrected entity:

\begin{code}
import { Entity, BaseEntity, Column, PrimaryGeneratedColumn } from 'typeorm';

@Entity()
export class MyEntity extends BaseEntity {
  @PrimaryGeneratedColumn()
  id: number;

  @Column('json')
  jsonData: object;
}
\end{code}

Note that I also added `'json'` as the type for the `@Column` decorator to specify that the column stores json data.

